import React from 'react';
import "./welcome.css";
import tutorial from "../../assets/tutorial.mp4";

const Welcome = () => {
    return (
        <div className="welcome">
            <video width="100%" height="100%"  controls muted autoPlay loop>
                <source src={tutorial} type="video/mp4" />
             </video>
        </div>
    )
};

export default Welcome;
